import React from 'react'; 
import Head from 'next/head';
import PropTypes from 'prop-types';
import AppLayout from '../components/AppLayout';

const DigitalGallery = ({ Component }) =>{
    return (
        <> 
        <Head>
            <title>Degital Gallery</title>
           {/* <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/antd/4.5.2/antd.compact.min.css"/> */}
            <link rel="stylesheet" href="https://fonts.googleapis.com/icon?family=Material+Icons" />
            <link rel="stylesheet" href="../index.css" /> 
            <link rel="stylesheet" href="../reset.css" /> 
        </Head>
        <AppLayout>
            <Component />
        </AppLayout>
        </>
    );
}

DigitalGallery.propTypes = {
    component: PropTypes.elementType, 
}

export default DigitalGallery;
